import { useEffect } from "react"
import { useDispatch } from "react-redux"
import { CurrentTab } from "../../../redux/general/general"

const Logs = () => {
    const dispatch = useDispatch()
    useEffect(() => {
        dispatch(CurrentTab("logs"))
    }, [])
    return(
        <>
            <h1>Logs</h1>
        </>
    )
}

export default Logs
